INSERT INTO `field_data_field_product_systemen_details` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `field_product_systemen_details_value`, `field_product_systemen_details_format`) VALUES
('node', 'product', 0, 1, 1, 'und', 0, '<div class="block block-1 text blue">\r\n<div class="wrapper-text">\r\n<div class="title white">\r\nDe Cup-a-Soup Mini Automaat\r\n</div>\r\n<div class="details-txt">\r\nMet de Cup-a-Soup Mini creëer je voor jouw werknemers een fijne nieuwe hangplek, naast het koffieapparaat. Zo zullen je werknemers hun dipjes de baas zijn, na een kop Cup-a-Soup. Dit Cup-a-Soup systeem biedt drie verschillende keuzes, dus voor ieder wat wils! Gemakkelijk in gebruik, met een druk op de knop wordt de soep automatische gedoseerd. Daarnaast is het verpakt in een mooi jasje, want ja.. Het oog wil natuurlijk ook wat. Zet de Cup-a-Soup mini naast uw heet water voorziening, een druk op de knop en genieten maar!\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class="block block-2 grey">\r\n￼Bij aankoop van 9 vendingzakken ontvangt u tijdelijk\r\nhet gratis MiNi startpakket:\r\n1 Cup-a-Soup MiNi systeem 50 Bekers\r\n</div>\r\n\r\n<div class="block block-3">\r\n<div class="cell-1">\r\n<div class="title block-title">\r\nKenmerken:\r\n</div>\r\n<div class="txt">\r\nGeschikt voor 50 - 150 personen\r\n3 wisselbare smaken\r\nInstelbaar volume voor bekertjes\r\nZelf water toevoegen\r\n</div>\r\n</div>\r\n\r\n<div class="cell-2">\r\n<div class="title block-title">\r\nVoordelen:\r\n</div>\r\n<div class="txt">\r\nProfessionele, stijlvolle presentatie\r\nGeconcentreerd verbruik\r\nGeen afval\r\n</div>\r\n</div>\r\n</div>', 'full_html');
